import React from 'react'

export const Productos = () => {

    const productos = [
        {id:1, nombre: 'Producto 1'},
        {id:2, nombre: 'Producto 2'},
        {id:3, nombre: 'Producto 3'},
        {id:4, nombre: 'Producto 4'},
        {id:5, nombre: 'Producto 5'},
        {id:6, nombre: 'Producto 6'},
    ];


    return (
        <div>
            <h3>Productos</h3>
            <p>aqui los productos</p>
        </div>
    )
}
